import App from './App';
import 'bootstrap/dist/css/bootstrap.min.css'
import React from 'react';  // Check the correct import based on your React version
import ReactDOM from 'react-dom';

ReactDOM.render(<App />, document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

